:text: |
  Descendants of WILLIAMS, William and NELSON, Jane
  JWILLIAMS, Emma Caroline and NELSON. William
  VNELSON, Lionel (Jack) and CHAMBERS, Esther Margaret
  JNELSON, Guy Harold and MATTHEWS, Rhoda Anne Marriott (Bobbie)
  INELSON, Mary Jane Rosamond and MOODIE, John Eisdell
  NELSON, Mary Jane Rosamond and MOODIE, John Eisdell (cont...)
  St Peter's School, Cambridge. She has recently completed an MA in History at Waikato University and
  has a particular interest in oral history.
  Both enjoy running a ten acres and large garden. They were previously involved in youth work in the
  Church. They continue to enjoy tramping when time allows, and also movie-going, theatre and opera.
  John maintains an interest in wood-turning.
  01> MOODIE, Sarah Caroline
  b 10.07.1970
  Sarah b. at Hamilton. She was educated at Tamahere Primary School and Hamilton
  Girls' High School then graduated BA in Art History from Canterbury University. She
  spent several years in the United Kingdom, working in Derby as a vocational guidance
  officer, and travelling in Europe. She returned to complete a journalism course in
  Wellington then worked for the Rotorua Daily Post for several years. She was then a
  Parliamentary Press Secretary and is currently writing a book. Sarah's interests
  include white-water kayaking, rock and ice climbing and writing.
  02> MOODIE, Gabrielle Anne
  b 22.04.1972
  Anne b. at Hamilton. She was educated at Tamahere Primary School and Hamilton Girls'
  High School and spent a year in Bogor, Indonesia as an American Field Scholar. She
  graduated BA in English and Classics from Canterbury University and LLB from
  Victoria University. She was admitted to the Bar in September 1997 and is currently
  practising in Rotorua. Anna's interests include dancing, kayaking and skiing.
  03> MOODIE, Thomas John
  b 17.01.1979
  Thomas b. at Hamilton. He was educated at Tamahere Primary School, Southwell School and St Peter's
  School, Cambridge, and is now studying Medicine at Otago University while living at Knox College.
  He enjoyed success at rowing at a national level while at St Peter's and is an enthusiastic skier
  and kayaker.
  03> NELSON, Virginia Frances
  b 29.12.1946
  Virginia b. at Hastings. Address: 74 Abberley Crescent, St Albans, Christchurch 1.
  Virginia was educated at Woodford House and graduated BA from the University of Canterbury. She joined
  the Justice Department as a probation officer and is now a service manager for the Community Probation
  Service.
  05> NELSON, Kathleen Margaret m on 15.04.1941 to THOMSON, Charles Herbert
  b 07.08.1918 d 15.06.1997
  b 15.05.1908
  Kathleen b. at Wellington and d. at Acacia Bay, Taupo.
  Kathleen had a diverse array of talents, all of which she took to a pitch of excellence. She was an actor,
  designer and wardrobe mistress for local theatre productions, an accomplished landscape painter
  particularly in water colours, a designer in miniature screen painting and craftsperson in sewing,
  spinning, wool dyeing, weaving and ornate rug making.
  Charles was a general practitioner and obstetrician with a very large country practice. Later in his life
  he was Chief Medical Officer on Niue Island. From 1970 until his retirement he practised in Taupo,
